import React,{useEffect,useState} from 'react'
import "../../assets/libs/datatables.net-bs4/css/dataTables.bootstrap4.min.css"
import "../../assets/libs/datatables.net-buttons-bs4/css/buttons.bootstrap4.min.css"
import "../../assets/libs/datatables.net-responsive-bs4/css/responsive.bootstrap4.min.css"
import "../../assets/css/bootstrap.min.css"
import "../../assets/css/icons.min.css"
import "../../assets/css/app.min.css"


import Table from '../../Components/Table'



function Contact() {


  let [tabledata,settabledata]=useState([])
  let [totalpagination,settotalpagination]=useState([])

  useEffect(()=>{

    axios.get(`${env(backendURL)}/contact`, {
      // params: {
      //   username: 'john1904',
      // }
    })
    .then(res=> {
      settabledata(tabledata=res.data)
    })

  })

  let columns=["Email","Name","Message","Status","Contact At","Modified Date"]
  let data=[
    {
      Name:"Taha Rasheed",  Position:"Developer" , Sallary:"3600"
    },
    {
      Name:"Taha Rasheed",  Position:"Developer" , Sallary:"3600"
    },
    {
      Name:"Taha Rasheed",  Position:"Developer" , Sallary:"3600"
    }
  ]

let showselect=()=>{

}

let showpagination=()=>{

}
let options=[100,50,10]

  return (
    <div>
      <Table columns={columns} data={data} options={options} tableheight={"10"} groups={5} onshowselect={showselect} onpaginationselect={showpagination} />
    </div>
  )
}

export default Contact
